import React, { useState, useEffect } from 'react';
import axios from 'axios';  // Importing axios library to make HTTP requests
import { useNavigate } from 'react-router-dom';  // Importing useNavigate hook from React Router

const Index = () => {
  // Declaring state variables using useState hook
  const [startRange, setStartRange] = useState('');  // State for start range input
  const [endRange, setEndRange] = useState('');  // State for end range input
  const [primeNumbers, setPrimeNumbers] = useState([]);  // State for storing prime numbers
  const [algorithmType, setAlgorithmType] = useState('');  // State for algorithm type input
  const [primeCount, setPrimeCount] = useState(0);  // State for counting prime numbers
  const [primeRecords, setPrimeRecords] = useState([]);  // State for storing prime number records

  const navigate = useNavigate();  // Using useNavigate hook for navigation

  useEffect(() => {
    handleGetPrimeRecords();  // Fetching prime number records when component mounts
  }, []);

  // Function to fetch prime number records from the server
  const handleGetPrimeRecords = async () => {
    try {
      const response = await axios.get('http://localhost:3001/api/data');  // Sending GET request to server
      setPrimeRecords(response.data);  // Setting prime number records in state
    } catch (error) {
      console.error('Error fetching data:', error);  // Handling error if fetching data fails
    }
  };
  
  // Function to handle button click event for generating prime numbers
  const handleclick = async () => {
    try {
      handleGenerate();  // Generating prime numbers
      const response = await axios.post('http://localhost:3001/api/data', {
        start: startRange,
        end: endRange,
        algorithm: algorithmType,
        numPrimes: primeCount,
      });  // Sending POST request to server with prime number generation details
      console.log(response);  // Logging server response
    } catch (error) {
      if (error.response) {
        console.log('Server Error:', error.response.data);  // Handling server error response
      } else if (error.request) {
        console.log('No response received from server:', error.request);  // Handling no response from server
      } else {
        console.log('Error:', error.message);  // Handling other errors
      }
    }
  };

  // Function to generate prime numbers within the specified range
  const handleGenerate = async () => {
    const start = parseInt(startRange);
    const end = parseInt(endRange);

    if (isNaN(start) || isNaN(end) || start >= end) {
      alert('Please enter valid start and end range!');  // Alerting user for invalid input
      return;
    }

    // Function to check if a number is prime
    const isPrime = (num) => {
      if (num <= 1) return false;
    
      const sieve = new Array(num + 1).fill(true);
      sieve[0] = false;
      sieve[1] = false;
    
      for (let i = 2; i * i <= num; i++) {
        if (sieve[i]) {
          for (let j = i * i; j <= num; j += i) {
            sieve[j] = false;
          }
        }
      }
    
      return sieve[num];
    };

    const primes = [];
    let count = 0;

    // Generating prime numbers within the specified range
    for (let i = start; i <= end; i++) {
      if (isPrime(i)) {
        primes.push(i);
        count++;
      }
    }

    // Setting generated prime numbers and count in state
    setPrimeNumbers(primes);
    setPrimeCount(count);
  };

  // Function to handle navigation to prime number records page
  const handleRedirect = () => {
    navigate('/database');  // Redirecting to '/database' route
  };

  // JSX for rendering UI
  return (
    <div>
      <div className="container bg-purple-50 mx-auto">
        <form className="mb-8">
          <div className='text-black shadow-xs font-bold py-5  text-2xl text-center'>Prime Number Generator</div>
          <div className="mb-4 mr-4 text-center">
            <label className='font-semibold mr-5'>Enter the starting range:</label>
            <input type="number" name="start" value={startRange} onChange={(e) => setStartRange(e.target.value)} className="border border-gray-300 rounded-md p-2 ml-2" />
          </div>
          <div className="mb-4 mr-4 text-center">
            <label className='font-semibold mr-7'>Enter the ending range:</label>
            <input type="number" name="end" value={endRange} onChange={(e) => setEndRange(e.target.value)} className="border border-gray-300 rounded-md p-2 ml-2" />
          </div>
          <div className="mb-4 mr-4 text-center">
            <label className='font-semibold mr-5'>Enter the algorithm type:</label>
            <input type="text" name="algorithm" value={algorithmType} onChange={(e) => setAlgorithmType(e.target.value)} className="border border-gray-300 rounded-md p-2 ml-2" />
          </div>
          <div className="flex justify-center mt-5 items-center">
            <button type="button" onClick={() => handleclick()} className="bg-purple-700 hover:bg-purple-900 text-white font-bold py-2 px-4 rounded">
              Generate
            </button>
          </div>
        </form>
        <div className='border text-center font-normal text-white pl-1 pb-2 justify-center bg-purple-500'>
          <h2 className="text-xl font-semibold text-white pt-5">Prime numbers between {startRange} and {endRange} are</h2>
          <p className=" text-xl font-semibold text-white">Algorithm used: {algorithmType} </p>
          <p className="mb-2 text-xl font-semibold text-white">Count of prime numbers: {primeCount}</p>
          <ul>
            {primeNumbers.map((num, index) => (
              <li key={index} className="list-disc ml-4">{num}</li>
            ))}
          </ul>
        </div>
        <div className='flex justify-center items-center my-5'>
          <button type="button" className=' bg-purple-700 hover:bg-purple-900 text-white font-bold py-2 px-4 rounded' onClick={handleRedirect}>
            Prime Number Records
          </button>
        </div>
      </div>
    </div>
  );
};

export default Index;
